import React from "react";

const DietSearch = () => {
  return (
    <div className="col-sm-3">
      <h1>Dietary Concerns</h1>
      <p>Diebetic Friendly</p>
      <p>Low cholesterol</p>
      <p>Low calories</p>
      <p>Vegetarian</p>
    </div>
  );
};

export default DietSearch;
